import styled from "styled-components";

const Button = styled.button`
  display: flex;
  flex-direction: row;
  justify-content: center;
  align-items: center;
  padding: 6px 6px 6px 8px;

  position: absolute;
  width: 382px;
  height: 48px;
  left: calc(50% - 382px / 2);
  top: calc(50% - 48px / 2 + 368px);

  /* Green - 900 - Primary */
  text-transform: uppercase;
  background: #149f65;
  border-radius: 4px;
`;

export function Skip({ chhildren }) {
  return <Button> {chhildren}</Button>;
}
